import React, { useState } from "react";

const initialBreeds = [
    {
        id: 1,
        name: 'Boxer'
    },
    {
        id: 2,
        name: 'Husky'
    },
]

const Select = () => {

    const [breeds, setBreeds] = useState(initialBreeds);

	return (
        <select>
			<option value='1'>Boxer</option>
			<option value='2'>Labrador</option>
		</select>
	);
};

export default Select;
